</div></div></div><div class="react-code-text react-code-line-contents" style="min-height:auto"><div><div id="LC101" class="react-file-line html-div" data-testid="code-cell" data-line-number="101" style="position:relative">LOCK TABLES <span class="pl-s"><span class="pl-pds">`</span>empresas<span class="pl-pds">`</span></span> WRITE;</div></div></div><div class="react-code-text react-code-line-contents" style="min-height:auto"><div><div id="LC102" class="react-file-line html-div" data-testid="code-cell" data-line-number="102" style="position:relative"><span class="pl-c"><span class="pl-c">/*</span>!40000 ALTER TABLE `empresas` DISABLE KEYS <span class="pl-c">*/</span></span>;</div></div></div><div class="react-code-text react-code-line-contents" style="min-height:auto"><div><div id="LC103" class="react-file-line html-div" data-testid="code-cell" data-line-number="103" style="position:relative">INSERT INTO `empresas` VALUES (1,&#039;Sonda&#039;,&#039;Sonda&#039;,23285174,&#039;0&#039;,&#039;mision&#039;,&#039;vision&#039;,&#039;web&#039;,&#039;historia&#039;,1,1),(2,&#039;Mobilitas SpA&#039;,&#039;Mobilitas SpA&#039;,76095037,&#039;8&#039;,&#039;&#039;,&#039;&#039;,&#039;www.ikwest.com&#039;,&#039;&#039;,20,0),(3,&#039;ZhetaPricing&#039;,&#039;ZhetaPricing Chile S.A.&#039;,76021508,&#039;2&#039;,&#039;Ser Lideres en el desarrollo de soluciones de Revenue Management en diversas industrias a nivel global para así generar valor económico sostenible a nuestros clientes.&#039;,&#039;&#039;,&#039;www.zpricing.com&#039;,&#039;&#039;,21,0),(4,&#039;Teki&#039;,&#039;Teki Soluciones de Software Ltda.&#039;,76055611,&#039;4&#039;,&#039;&#039;,&#039;&#039;,&#039;http://www.teki.cl&#039;,&#039;&#039;,30,0),(5,&#039;Newtenberg&#039;,&#039;Newtenberg Publicaciones Digitales Limitada&#039;,77543180,&#039;6&#039;,&#039;Proveer soluciones de tecnología para la comunicación humana para distintos contextos&#039;,&#039;Newtenberg, el Nuevo Gutenberg, es una compañía chilena dedicada al desarrollo de tecnologías de información que permitan apoyar los procesos de informar, comunicar y coordinar acciones entre las personas. Bajo esta premisa un grupo multidisciplinario de profesionales ha combinado los mundos del diseño, software y medios de comunicación para proveer a las organizaciones de tecnologías y prácticas virtuosas en el manejo de información y coordinación de sus “haceres”.  &#039;,&#039;http://www.newtenberg.com/&#039;,&#039;Hacia 1450 la aparición de la Imprenta de Tipos Móviles de Gutenberg permitió la revitalización del desarrollo intelectual de nuestra cultura entregándonos la posibilidad de acceder al conocimiento de la sociedad en formato libro. Esta tecnología improntó en el conocimiento dos restricciones que no le son inherentes: la serialización y la jerarquización, si bien el libro es una contribución en si, el resultado de su aplicación por mas de 500 años ha conducido a un dinámica fragmentaria en que los libros de matemáticas, filosofía o historia necesariamente pertenecen a áreas del conocimiento casi disjuntas. \r\nLa aparición del WWW hacia 1992 y la conceptualización de los hipertextos desde mucho antes, abren la posibilidad de una interrelación distinta que posibilita la recomposición de los contenidos y la posibilidad de aproximaciones no lineales que implican una transformación cultural importante para un mundo obsesionado con la búsqueda de jerárquías únicas y con el afán de sentar convenciones universales que obligan a otros a mirar y pensar de una única forma.\r\nEl aporte de Newtenberg en este contexto viene de la mano del estudio del fenómeno de la comunicación humana en términos de la biología, el rol del lenguaje, el establecimiento de protocolos, la registro de observaciones y la integración de distintas visiones: software, medios de comunicación, bibliotecología, diseño de información.\r\nA partir del año 2000 esto se traduce en el desarrollo tecnológico de una plataforma para la documentación y organización del conocimiento: basada en 3 distinciones: una unidad básica de contenido universal (eidox), soporte para taxonomías y miradas semánticas múltiples (clasificandos) y un modelamiento de cualquier sistema humano de coordinación como una conversación que se registra y caracteriza.\r\nEsta aproximación ha permitido a la compañía resolver con la misma plataforma un conjunto diverso de problemas: desde la recopilación de fuentes primarias de la historia, la organización de sistemas legales y de jurisprudencia, el desarrollo de grandes portales de información y recientemente el monitoreo de todo tipo de indicadores.\r\nNos interesa trabajar con personas que amen su trabajo y aspiren a que las obras que desarrollemos en conjunto sean una contribución al desarrollo de la sociedad e impacten positivamente en la educación de las nuevas generaciones.    &#039;,37,0);</div></div></div><div class="react-code-text react-code-line-contents" style="min-height:auto"><div><div id="LC104" class="react-file-line html-div" data-testid="code-cell" data-line-number="104" style="position:relative"><span class="pl-c"><span class="pl-c">/*</span>!40000 ALTER TABLE `empresas` ENABLE KEYS <span class="pl-c">*/</span></span>;</div></div></div><div class="react-code-text react-code-line-contents" style="min-height:auto"><div><div id="LC105" class="react-file-line html-div" data-testid="code-cell" data-line-number="105" style="position:relative">UNLOCK TABLES;</div></div></div><div class="react-code-text react-code-line-contents" style="min-height:auto"><div><div id="LC106" class="react-file-line html-div" data-testid="code-cell" data-line-number="106" style="position:relative">
